import React from 'react'

function Shop() {
    var items =
    fetch('api/goods/')
        .then(response => response.json())
        .then(shop_json => {
            JSON.parse(shop_json.data)
        })
    return (
        <div>
            <h2>Shop</h2>
        </div>
    )
}

export default Shop
